import RestoreFromTrashIcon from '@material-ui/icons/RestoreFromTrash';

const theme = createMuiTheme({
    spacing: 4
});

const styles = {
    root: {
        padding: '4px 4px',
        display: 'flex',
        alignItems: 'center',
        width: 310,
        boxShadow: 'None',
        borderRadius: 0,

